import React from 'react';
import './App.css';
import Navigation from './components/navbar';
import Jumbotron from './components/jumbotron';

class App extends React.Component {
    render() {
        return (
                <div className="App">
                    <Navigation></Navigation>
                    <Jumbotron></Jumbotron>
                </div>
        );
    }
}


export default App;
